import React from "react";
import navIcon from "../assets/navIcon.svg";
// import "../components/style.css";
const Navbar = () => {
  return (
    // box-shadow: 0 8px 32px 0 rgba( 31, 38, 135, 0.37 );
    <div className="container z-10 fixed navbar__earthly flex rounded-[1.31rem] items-center justify-between px-4 py-4 mx-auto w-9/12 h-16 bg-[#e1e1e140] left-1/2 -translate-x-1/2 translate-y-4 backdrop-blur-[0.188rem] border border-solid border-[#e1e1e12e] shadow-custom">
      {/* logo */}
      <div className=" font-[itim] text-3xl pl-4 justify-center items-center text- hover:text-[#285430] ">
        <p>earthly.ie</p>
      </div>
      {/* links */}
      <ul className="flex list-none gap-16 font-[inter] items-center justify-center text-white text-lg pr-4 cursor-pointer ">
        <li className="hover:text-primaryOne">Home</li>
        <li className="hover:text-primaryOne">Shop</li>
        <li className="hover:text-primaryOne">About Us</li>
        <li>
          <button className=" rounded-[0.563rem] bg-primaryTwo py-2 px-4 hover:bg-primaryThree hover:text-primaryOne">

            Get in Touch
          </button>
        </li>
        <li>
          <img src={navIcon} alt="Cart Icon" />
        </li>
      </ul>
    </div>
  );
};

export default Navbar;
